3 steps to natural makeup at every age ! Drop a ♥️ if this could be your routine 🤎

Muse: @beautybyharper 

1. Hydrate to the max! - Everyone at every age and every skin type needs hydration. It’s a non negotiable first step before makeup application !

Pictured: @danessamyricksbeauty Original Beauty Oil

2. Radiance = fountain of youth. - Define the level of radiance that feels good for you and build it into your routine. You can infuse glow any any point of your routine , under foundation, I’m your foundation or on top of your foundation. 

Pictured: @danessamyricksbeauty Illuminating Veil in “Radiance” applied underneath the foundation 

3. Creams are a dream.- Infuse crbased products as much as you can throughout your application. Cream make blending easy and layer naturally on the skin.  Creams are my pro artistry go-to!

